import Logo from '../../assets/images/logo_Kasa_acceuil.png'
import NavigationLink from '../navigationLink/NavigationLink';
import '.composants/header/header.scss'

function Header() {
    return (
    
        <div>
            <div><img src={Logo} alt="logo"/></div>
            
            <nav>
                <div>
                <NavigationLink />
                </div>
           </nav>
           
        </div>
    )
};

export default Header;
